    return (
        <div className="header">
            <h1>Light and dark mode</h1>
            <div className="header__switch">
                <label className="switch">
                    <input type="checkbox" />
                    <span className="slider round"></span>
                </label>
            </div>
        </div>
    );
    }
export default Header;
